import Globais from "./Globais";
import { useState } from "react";
import Axios from "axios";

function VerPerfil(foto, user){
    const [perfil, setPerfil] = useState([]);
    const userName = Globais.user;
    let imagem = "";

    return (
        <div>
            <img src={imagem} width="30"></img>
            <label className="profile">@{Globais.user}</label>
        </div>
    )
}

export default VerPerfil;
